import classes from './MealItemsForm.module.css'
import Input from '../../UI/Input'

const MealItemsForm = props => {
    return (
       <form className={classes.form}>
         <Input label="Amout" input={{
            id: 'amount',
            type: 'number',
            min: '5',
            step
         }}
         />
         <button>+ Add</button>
       </form>
    )
}

export default MealItemsForm
